var init, initFilesRanksBRD;

$(function() {
  init();
  return console.log("Main Init Called");
});

initFilesRanksBRD = function() {
  var file, i, index, rank, ref, ref1, results, sq;
  index = 0;
  while (index < BOARD_SQUARE_NUMBER) {
    FILESBOARD[index] = SQUARES.OFFBOARD;
    RANKSBOARD[index] = SQUARES.OFFBOARD;
    index++;
  }
  results = [];
  for (rank = i = ref = RANKS.RANK_1, ref1 = RANKS.RANK_8; ref <= ref1 ? i <= ref1 : i >= ref1; rank = ref <= ref1 ? ++i : --i) {
    results.push((function() {
      var j, ref2, ref3, results1;
      results1 = [];
      for (file = j = ref2 = FILES.FILE_A, ref3 = FILES.FILE_H; ref2 <= ref3 ? j <= ref3 : j >= ref3; file = ref2 <= ref3 ? ++j : --j) {
        sq = FR2SQ(file, rank);
        FILESBOARD[sq] = file;
        results1.push(RANKSBOARD[sq] = rank);
      }
      return results1;
    })());
  }
  return results;
};

init = function() {
  console.log("initializing...");
  return initFilesRanksBRD();
};
